//! Minimal vendored Swagger UI assets to allow offline builds.
//! The bytes below encode a small Swagger UI ZIP archive with a
//! `dist` directory and stub assets. Keeping the archive inline
//! avoids committing binary assets directly to the repository.
//!
//! To refresh the archive, regenerate a ZIP and paste the byte values here.
//! For example:
//! ```bash
//! python - <<'PY'
//! import io, zipfile
//! root = 'swagger-ui-5.17.14'
//! files = {
//!     f"{root}/dist/swagger-initializer.js": "window.ui = SwaggerUIBundle({ url: 'openapi.json' });\n",
//!     f"{root}/dist/index.html": "<!doctype html><title>Swagger UI stub</title><div id='swagger-ui'></div>\n",
//!     f"{root}/dist/swagger-ui-bundle.js": "console.log('swagger ui bundle stub');\n",
//!     f"{root}/dist/swagger-ui-standalone-preset.js": "console.log('swagger ui preset stub');\n",
//! }
//! buf = io.BytesIO()
//! with zipfile.ZipFile(buf, 'w', zipfile.ZIP_DEFLATED) as z:
//!     for path, content in files.items():
//!         z.writestr(path, content)
//! data = buf.getvalue()
//! print(', '.join(str(b) for b in data))
//! PY
//! ```
